import React from 'react'

const getLogins = () => {
    Axios.get("http://localhost:4500/logins").then( (response) => {
      console.log("Retrieved login data");
      console.log(response)
    });
  };


function LoginTable() {
  return (
    <div>
      {getLogins}
    </div>
  )
}

export default LoginTable
